CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpGetOwnedPermission`(IN _language varchar(10), IN _userId CHAR(32))
BEGIN
	SET @languages=_language;
	SET @userId=_userId;
	PREPARE _stmt FROM 'SELECT permission.ID, permission.OBJECT, permission.OPERATION, permission.LABEL, permission.DETAIL, permission.PERMISSION_CODE
		FROM tb_sys_permission AS permission
		LEFT JOIN tb_sys_user_permission AS up ON up.PERMISSION_ID=permission.ID
		LEFT JOIN tb_sys_role_permission AS rp ON rp.PERMISSION_ID=permission.ID
		LEFT JOIN tb_sys_user_role AS ur ON ur.ROLE_ID=rp.ROLE_ID
		WHERE up.USER_ID=? OR ur.USER_ID=?';
	EXECUTE _stmt USING @userId, @userId;
	DEALLOCATE PREPARE _stmt;
    END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

