--
-- Definition of procedure `SpGetPermission`
--

DROP PROCEDURE IF EXISTS `SpGetPermission`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpGetPermission`(IN _userId char(32),OUT _permission  BIGINT)
BEGIN
DECLARE done INT DEFAULT 0;
DECLARE permCode int;
DECLARE permission BIGINT;
DECLARE cur1 CURSOR FOR SELECT t1.PERMISSION_CODE FROM tb_sys_permission AS t1,tb_sys_role_permission AS t2,tb_sys_user_role AS t3 where t3.USER_ID=_userId and t1.ID=t2.PERMISSION_ID and t2.ROLE_ID=t3.ROLE_ID;
DECLARE cur2 CURSOR FOR SELECT t1.PERMISSION_CODE FROM tb_sys_permission AS t1,tb_sys_user_permission AS t2 where t2.USER_ID=_userid and t1.ID=t2.PERMISSION_ID;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
set permission = 0;
set done = 0;
OPEN cur1;
REPEAT
    FETCH cur1 INTO permCode;
    set permission = permission | (1 << permCode);	
UNTIL done END REPEAT;
CLOSE cur1;
set done = 0;
OPEN cur2;
REPEAT
    FETCH cur2 INTO permCode;
    set permission = permission | (1 << permCode);	
UNTIL done END REPEAT;
CLOSE cur2;
set _permission = permission;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

