DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpListRoles`(IN pageNo INT, INOUT pageLimit INT, IN orderBy INT, IN orderDesc INT, OUT totalRecords INT)
BEGIN
	IF pageNo IS NULL OR pageNo = 'null' OR pageNo = '' OR pageNo < 1 THEN
		SET @pageNo=1;
	ELSE
		SET @pageNo=pageNo;
	END IF;
	IF pageLimit IS NULL OR pageLimit = 'null' OR pageLimit = '' OR pageLimit < 1 THEN
		SET @pageLimit=30;
	ELSE
		SET @pageLimit=pageLimit;
	END IF;
	SET pageLimit=@pageLimit;
	IF orderBy IS NULL OR orderBy = 'null' OR orderBy = '' OR orderBy < 0 THEN
		SET @orderBy=2;
	ELSE
		SET @orderBy=orderBy;
	END IF;
	IF orderDesc IS NULL OR orderDesc = 'null' OR orderDesc = '' OR orderDesc=0 THEN
		SET @orderDesc='ASC';
	ELSE
		SET @orderDesc='DESC';
	END IF;
	SELECT COUNT(role.ID) INTO totalRecords FROM tb_sys_role AS role;
	SET @pageStart = (pageNo - 1) * @pageLimit;
	SET @listSql=CONCAT('SELECT role.ID, role.NAME, role.APP_STATUS, role.REMARK FROM tb_sys_role AS role ORDER BY ? ', @orderDesc, ' LIMIT ?,?');
	PREPARE _stmt FROM @listSql;
	EXECUTE _stmt USING @orderBy, @pageStart, @pageLimit;
	DEALLOCATE PREPARE _stmt;
	END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

