/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpSaveUser`(IN id CHAR(32), IN password VARCHAR(20), IN name VARCHAR(256), IN email VARCHAR(256), IN tel VARCHAR(30), IN remark VARCHAR(2048),
		IN idcardno VARCHAR(32), IN type CHAR(32), IN userId CHAR(32), OUT forwardUI VARCHAR(64))
BEGIN
	SET @nowTime=NOW();
	IF id is NULL OR id = '' THEN
		SET @id=UUID32();
	ELSE
		SET @id=id;
	END IF;
	SET @userId=userId, @password=password, @name=name, @email=email, @tel=tel, @remark=remark, @idcardno=idcardno, @type=type, @status='402881e71873f01c0118740714810052';
	IF id IS NULL OR id = '' THEN
		PREPARE _stmt FROM 'INSERT INTO tb_sys_user (ID, CREATE_BY, CREATE_TIME, UPDATE_BY, UPDATE_TIME, PASSWORD, NAME, EMAIL, TEL, REMARK, 
			IDCARDNO, STATUS, TYPE)	VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?)';
		EXECUTE _stmt USING @id, @userId, @nowTime, @userId, @nowTime, @password, @name, @email, @tel, @remark, @idcardno, @status, @type;
	ELSE
		PREPARE _stmt FROM 'UPDATE tb_sys_user SET UPDATE_BY=?, UPDATE_TIME=?, PASSWORD=?, NAME=?, EMAIL=?, TEL=?, REMARK=?, 
			IDCARDNO=?, TYPE=? WHERE ID=?';
		EXECUTE _stmt USING @userId, @nowTime, @password, @name, @email, @tel, @remark, @idcardno, @type, @id;
	END IF;
	DEALLOCATE PREPARE _stmt;
	SET forwardUI='common.parent_refresh.r';
    END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

