-- Definition of procedure `SpShowPermission`
--

DROP PROCEDURE IF EXISTS `SpShowPermission`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpShowPermission`(IN cosmosUserId CHAR(32), IN permissionId CHAR(32))
BEGIN
		
		SET @permissionId = permissionId;
		
		SELECT ID, CREATE_BY, CREATE_TIME, UPDATE_BY, UPDATE_TIME, OBJECT, OPERATION, LABEL, DETAIL, PERMISSION_CODE 
			FROM tb_sys_permission WHERE ID=@permissionId;
	
    END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `SpShowRole`
--

DROP PROCEDURE IF EXISTS `SpShowRole`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SpShowRole`(IN roleId CHAR(32))
BEGIN
	SELECT ID,CREATE_BY,CREATE_TIME,UPDATE_BY,UPDATE_TIME,NAME,APP_STATUS,REMARK
	FROM tb_sys_role WHERE ID=roleId;
    END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `SP_MYSQL_COSMOS_LOADER`
--

DROP PROCEDURE IF EXISTS `SP_MYSQL_COSMOS_LOADER`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`cosmos`@`%` PROCEDURE `SP_MYSQL_COSMOS_LOADER`()
BEGIN
select type,name,FN_MYSQL_COSMOS_ARGLIST(returns,param_list) as argList from mysql.proc where db='cosmos' order by type;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

